function () {
  const tratamentosMedicos = get_animal_tratamento_medico.data || [];
  const periodosDeDias = [];
  tratamentosMedicos.data.forEach(tratamento => {
    const dataInicio = new Date(tratamento.tratamento_medico.data_inicio);
    const dataFim = new Date(tratamento.tratamento_medico.data_fim);
    const diferencaEmMilissegundos = dataFim - dataInicio;
    const diferencaEmDias = Math.floor(diferencaEmMilissegundos / (1000 * 60 * 60 * 24));
    periodosDeDias.push(diferencaEmDias);
  });
  return periodosDeDias;
}

function () {
  const tratamentosMedicosPorId = get_animal_tratamento_medico.data.data.reduce((acc, item) => {
    acc[item.id] = item;
    return acc;
  }, {});
  const nomesDasDoencas = [];
  get_e_causado.data.data.forEach(item => {
    const tratamentoMedico = tratamentosMedicosPorId[item.tratamento_medico.id];
    if (tratamentoMedico) {
      const nomeDaDoenca = item.doenca.nome;
      nomesDasDoencas.push(nomeDaDoenca);
    }
  });
  return nomesDasDoencas;
}

function () {
  let tratamentosMedicos = get_animal_tratamento_medico.data || [];
  tratamentosMedicos.data.forEach(tratamento => {
    const dataInicio = new Date(tratamento.animal.Data_nascimento);
    const dataAtual = new Date();
    const diferencaEmAnos = dataAtual.getFullYear() - dataInicio.getFullYear();
    if (dataInicio.getMonth() > dataAtual.getMonth() || dataInicio.getMonth() === dataAtual.getMonth() && dataInicio.getDate() > dataAtual.getDate()) {
      tratamento.animal.Idade = diferencaEmAnos - 1;
    }
  });
  return tratamentosMedicos;
}

function () {
  const tratamentos = get_animal_tratamento_medico.data.data || [];
  const dosagens = get_possuis.data.data || [];
  const tratamentosPorId = tratamentos.reduce((map, tratamento) => {
    map[tratamento.id] = tratamento;
    return map;
  }, {});
  dosagens.forEach(dosagem => {
    const tratamentoId = dosagem.tratamento_medico.id;
    const tratamento = tratamentosPorId[tratamentoId];
    if (tratamento) {
      if (!tratamento.dosagens) {
        tratamento.dosagens = [];
      }
      tratamento.dosagens.push({
        id: dosagem.id,
        prescricao: dosagem.prescricao,
        dosagem: dosagem.dosagem
      });
    }
  });
  return tratamentos;
}

